const SunIcon = ({ className = "h-6 w-6", strokeWidth = "1.5" }) => {
  return (
    <svg
      stroke="currentColor"
      fill="none"
      strokeWidth={strokeWidth}
      viewBox="0 0 24 24"
      strokeLinecap="round"
      strokeLinejoin="round"
      className={className}
      height="1em"
      width="1em"
      xmlns="http://www.w3.org/2000/svg"
